import React, { useState, useEffect } from "react";
import "./App.css";
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Button from 'react-bootstrap/Button';
import ToggleButtonGroup from 'react-bootstrap/ToggleButtonGroup';
import ToggleButton from 'react-bootstrap/ToggleButton';


import ReactDOM from 'react-dom';
function Header() {
  return (
    <header>
      <h1>Let's Predict Success chance of your restaurant</h1>
      <nav>
        <a href="#about">Genius Developers</a>
        {/* <a href="#account">Account</a> */}
      </nav>
    </header>
  );
}

// About section component
function About() {
  return (
    <section id="about">
      <h2>About</h2>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam pretium, velit ut elementum congue, arcu ipsum convallis mi, at suscipit magna mi nec est. Suspendisse potenti. Proin sed eros quam. Fusce consequat vestibulum nisi vel molestie. Integer malesuada nulla ac justo hendrerit, quis elementum tellus dapibus. Donec vehicula consectetur arcu, ac aliquam metus vehicula vel. </p>
    </section>
  );
}

function App() {
    // usestate for setting a javascript
    // object for storing and using data
    const [data, setdata] = useState({
        name: "",
        age: 0,
        date: "",
        programming: "",
    });
    const [online,setOnline] = React.useState(true);
    const [table,settable] = React.useState(true);
    const [location,setlocation] = React.useState("");
    const [rest_type,setRest_type] = React.useState("");
    const [cusine,setCusine] = React.useState("");
    const [cost,setCost] = React.useState("");
    useEffect(() => {console.log('cusnie',cusine)},[cusine])


    const Dropdown_Select =  ({type,fields}) => {
      return (
        <div class="dropdown">
        <button class="dropbtn">Select {type}</button>
        <div class="dropdown-content">
          {type === 'Cusine' &&
            fields.map((field,index) => {
              console.log('index',index)
              return (
                <button key={index} onClick={setCusine(field)}>{field} </button>
              )
            })
          }
          {type === 'Location' &&
            fields.map((field,index) => {
              console.log('index',index)
              return (
                <button key={index} onClick={setlocation(field)}>{field} </button>
              )
            })
          }
          {type === 'Rest_type' &&
            fields.map((field,index) => {
              console.log('index',index)
              return (
                <button key={index} onClick={setRest_type(field)}>{field} </button>
              )
            })
          }
        </div>
      </div>
      );
    }

    // Account section component
    function Account() {
      return (
        <section id="account">
          <h2>Enter restaurant details</h2>
          <form>
            <label>Online order facility? :</label>
            <label>
            <input  onSelect={setOnline(true)}type="radio" name="Online" value={online} />
            Yes{' '}
            <input onSelect={setOnline(false)}  type="radio" name="Online" value={online} />
            No
          </label><br />
            <label >Booking facility? :</label>
            <label>
            <input  onSelect={settable(true)} type="radio" name="table" value={table} />
            Yes{' '}
            <input onSelect={settable(false)}  type="radio" name="table" value={table} />
            No
          </label>
            <p style={{width: 700}}>Select Location : {location}</p>
            <Dropdown_Select type='Location' fields={['Chinies','Italian']}/><br />
            <p style={{width: 700}}>Select restaurant type : {rest_type}</p>
            <Dropdown_Select type='Rest_type' fields={['Chinies','Italian']}/><br />
            <p style={{width: 700}}>Select Cuisines of your restaurant :  {cusine}</p>
            <Dropdown_Select type='Cusine' fields={['Chinies','Italian']}/><br /><br />   
            <label htmlFor="password">Enter Cost :</label>
            <input type="password" id="password" name="password" /><br /><br />
            <input type="submit" value="Submit" />
            </form>
        </section>
      );
    }

    // Using useEffect for single rendering
    useEffect(() => {
        // Using fetch to fetch the api from 
        // flask server it will be redirected to proxy
        fetch("/data").then((res) =>
            res.json().then((data) => {
                // Setting a data from api
                setdata({
                    name: data.Name,
                    age: data.Age,
                    date: data.Date,
                    programming: data.programming,
                });
            })
        );
    }, []);

    return (

      <div className="App">
      <Header />
      <main>
        {/* <About /> */}
        <Account />
      </main>
    </div>
    );
}

export default App;
